import React from "react";
const ProductsListasadmin = (props) => {
  return (
    <div>
      <div className="products-details">
        {props.data.map((e, i) => {
          return (
            <div class="card">
              <div class="card-border-top"></div>
              <div>
                <img
                  class="img"
                  src={e.imageUrl}
                  onClick={() => props.detail(e)}
                />
              </div>
              <span> {e.name}</span>
              <p class="job"> {e.price}</p>
              <button
                onClick={() => {
                  props.switchView("updateproject");
                  props.setId(e.id);
                }}
              >
                update
              </button>
              <button
                onClick={() => {
                  props.deleteProduct(e);
                }}
              >
                delete
              </button>
            </div>
          );
        })}
        <br />
      </div>
      <div className="divaddbutton">
        <button
          className="addbutton"
          onClick={() => {
            props.switchView("addproject");
          }}
        >
          {" "}
          ADD Project
        </button>
      </div>
    </div>
  );
};
export default ProductsListasadmin;
